import React, { useContext, useState } from 'react';
import { InventoryContext } from '../context/InventoryContext';

const ProductManagement = () => {
  const { products, addProduct, updateProduct, deleteProduct } = useContext(InventoryContext);

  // State to handle form input
  const [productForm, setProductForm] = useState({
    name: '',
    description: '',
    category: '',
    price: 0,
    quantity: 0,
  });
  const [isEditing, setIsEditing] = useState(false);
  const [editIndex, setEditIndex] = useState(null); // Track the index of the product being edited

  // Handle input changes
  const handleChange = (e) => {
    const { name, value } = e.target;
    setProductForm(prev => ({ ...prev, [name]: value }));
  };

  // Handle form submission
  const handleSubmit = (e) => {
    e.preventDefault();
    if (isEditing) {
      // Update the product if we are in edit mode
      updateProduct(editIndex, productForm); // Pass the index and product data
      setIsEditing(false); // Reset editing state
      setEditIndex(null); // Reset edit index
    } else {
      // Add a new product
      addProduct(productForm); // Add product directly
    }

    // Reset the form fields
    setProductForm({ name: '', description: '', category: '', price: 0, quantity: 0 });
  };

  // Handle edit action
  const handleEdit = (index) => {
    // Set the form data to the selected product for editing
    setProductForm(products[index]); // Get the product using index
    setIsEditing(true);
    setEditIndex(index); // Set the index of the product being edited
  };

  // Handle delete action
  const handleDelete = (index) => {
    deleteProduct(index); // Call deleteProduct function with the index
  };

  return (
    <div>
      <h1>Product Management</h1>
      <form onSubmit={handleSubmit}>
        <input type="text" name="name" value={productForm.name} onChange={handleChange} placeholder="Product Name" required />
        <input type="text" name="description" value={productForm.description} onChange={handleChange} placeholder="Description" required />
        <input type="text" name="category" value={productForm.category} onChange={handleChange} placeholder="Category" required />
        <input type="number" name="price" value={productForm.price} onChange={handleChange} placeholder="Price (M currency)" required />
        <input type="number" name="quantity" value={productForm.quantity} onChange={handleChange} placeholder="Initial Quantity" required />
        <button type="submit">{isEditing ? 'Update Product' : 'Add Product'}</button>
      </form>

      {/* Product Table */}
      <h2>Products</h2>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Description</th>
            <th>Category</th>
            <th>Price</th>
            <th>Quantity</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {products.map((product, index) => (
            <tr key={index}>
              <td>{product.name}</td>
              <td>{product.description}</td>
              <td>{product.category}</td>
              <td>{product.price} M</td>
              <td>{product.quantity}</td>
              <td>
                <button onClick={() => handleEdit(index)}>Edit</button>
                <button onClick={() => handleDelete(index)}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ProductManagement;
